package io.whatsapp.clonewhatsapp.model;/** * Created by rafaelcarvalho on 20/12/2017. */public class Contato {    private String identificarUsuario;    private String nome;    private String email;    public Contato() {    }    public String getIdentificarUsuario() {        return identificarUsuario;    }    public void setIdentificarUsuario(String identificarUsuario) {        this.identificarUsuario = identificarUsuario;    }    public String getNome() {        return nome;    }    public void setNome(String nome) {        this.nome = nome;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }}